import React, { useEffect, useRef } from 'react';
import { useNavigate } from 'react-router-dom';

const Dashboard = () => {
  const navigate = useNavigate();

  const topRightContainerRef = useRef(null);

  useEffect(() => {
    // Dynamically position the top-right container
    const container = topRightContainerRef.current;
    if (container) {
      container.style.position = 'absolute';
      container.style.top = '20px';
      container.style.right = '20px';
      container.style.display = 'flex';
      container.style.alignItems = 'center';
      container.style.gap = '15px';
    }
  }, []);

  const handleViewClubs = () => {
    navigate('/clubs');
  };

  const handleViewEvents = () => {
    navigate('/events');
  };

  const handleViewResources = () => {
    navigate('/resources');
  };

  const handleDeleteAccount = () => {
    navigate('/delete-account');
  };

  const handleLogout = () => {
    navigate('/logout');
  };

  const handleAbout = () => {
    navigate('/about');
  };

  return (
    <div
      className="dashboard-container"
      style={{
        position: 'relative',
        padding: '20px',
        fontFamily: "'Arial', sans-serif",
        backgroundColor: '#f8f9fa',
        minHeight: '100vh',
      }}
    >
      {/* Top-right actions */}
      <div ref={topRightContainerRef}>
        <div style={{ textAlign: 'right' }}>
          <h4 style={{ margin: 0, color: '#343a40' }}>John Doe</h4>
          <p style={{ margin: 0, fontSize: '14px', color: '#6c757d' }}>john.doe@example.com</p>
        </div>
        <button
          onClick={handleAbout}
          style={{
            padding: '8px 12px',
            backgroundColor: '#17a2b8',
            color: '#fff',
            border: 'none',
            borderRadius: '5px',
            cursor: 'pointer',
            fontSize: '14px',
          }}
        >
          About
        </button>
        <button
          onClick={handleLogout}
          style={{
            padding: '8px 12px',
            backgroundColor: '#6c757d',
            color: '#fff',
            border: 'none',
            borderRadius: '5px',
            cursor: 'pointer',
            fontSize: '14px',
          }}
        >
          Logout
        </button>
        <button
          onClick={handleDeleteAccount}
          style={{
            padding: '8px 12px',
            backgroundColor: '#dc3545',
            color: '#fff',
            border: 'none',
            borderRadius: '5px',
            cursor: 'pointer',
            fontSize: '14px',
          }}
        >
          Delete Account
        </button>
      </div>

      {/* Main Content */}
      <div
        style={{
          textAlign: 'center',
          marginTop: '100px',
        }}
      >
        <h1 style={{ marginBottom: '40px', color: '#343a40' }}>Dashboard</h1>
        <div
          style={{
            display: 'flex',
            justifyContent: 'center',
            gap: '30px',
          }}
        >
          <button
            onClick={handleViewClubs}
            style={{
              padding: '15px 30px',
              backgroundColor: '#007bff',
              color: '#fff',
              border: 'none',
              borderRadius: '5px',
              cursor: 'pointer',
              fontSize: '16px',
              boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
              transition: 'transform 0.2s, box-shadow 0.2s',
            }}
            onMouseEnter={(e) => {
              e.target.style.transform = 'scale(1.05)';
              e.target.style.boxShadow = '0 6px 8px rgba(0, 0, 0, 0.15)';
            }}
            onMouseLeave={(e) => {
              e.target.style.transform = 'scale(1)';
              e.target.style.boxShadow = '0 4px 6px rgba(0, 0, 0, 0.1)';
            }}
          >
            View All Clubs
          </button>
          <button
            onClick={handleViewEvents}
            style={{
              padding: '15px 30px',
              backgroundColor: '#007bff',
              color: '#fff',
              border: 'none',
              borderRadius: '5px',
              cursor: 'pointer',
              fontSize: '16px',
              boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
              transition: 'transform 0.2s, box-shadow 0.2s',
            }}
            onMouseEnter={(e) => {
              e.target.style.transform = 'scale(1.05)';
              e.target.style.boxShadow = '0 6px 8px rgba(0, 0, 0, 0.15)';
            }}
            onMouseLeave={(e) => {
              e.target.style.transform = 'scale(1)';
              e.target.style.boxShadow = '0 4px 6px rgba(0, 0, 0, 0.1)';
            }}
          >
            View All Events
          </button>
          <button
            onClick={handleViewResources}
            style={{
              padding: '15px 30px',
              backgroundColor: '#007bff',
              color: '#fff',
              border: 'none',
              borderRadius: '5px',
              cursor: 'pointer',
              fontSize: '16px',
              boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
              transition: 'transform 0.2s, box-shadow 0.2s',
            }}
            onMouseEnter={(e) => {
              e.target.style.transform = 'scale(1.05)';
              e.target.style.boxShadow = '0 6px 8px rgba(0, 0, 0, 0.15)';
            }}
            onMouseLeave={(e) => {
              e.target.style.transform = 'scale(1)';
              e.target.style.boxShadow = '0 4px 6px rgba(0, 0, 0, 0.1)';
            }}
          >
            View All Resources
          </button>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
